import React from 'react';
import { Navbar, Nav, Container, Button } from 'react-bootstrap';
import './Navbar.css'; 

// Import SVG files as React components
import { ReactComponent as ArrowLeftIcon } from '../assets/icons/arrow-left.svg';
import { ReactComponent as PlusIcon } from '../assets/icons/plus.svg';
import { ReactComponent as DownloadIcon } from '../assets/icons/download.svg';
import { ReactComponent as AvatarIcon } from '../assets/icons/avatar.svg';
import { ReactComponent as ThreeDotsIcon } from '../assets/icons/threedots.svg';

function AppNavbar() {
  return (
    <Navbar bg="white" expand="lg" className="pt-4 pb-5">
      <Container fluid>
        <Nav className="align-items-center">
          <Nav.Link href="#" className="p-0">
            <ArrowLeftIcon width="24" height="24" style={{color: '#444444'}} />
          </Nav.Link>
          <div className="divider-nav mx-3"></div>
          <AvatarIcon width="32" height="32" className="me-2 rounded-circle" />
          <Navbar.Text className="p-0 me-3">Alia Bhatt</Navbar.Text>
          <span className="badge bg-primary badge-custom-padding">4 updates</span>
        </Nav>
        <Nav className="ms-auto d-flex align-items-center">
          <Button variant="primary" className="rounded-circle btn-custom-circle me-4">
            <PlusIcon width="14" height="14" style={{color: '#ffffff'}} />
          </Button>
          <Button variant="outline-primary" className="me-4 btn-custom-padding">
            <DownloadIcon width="16" height="16" className="me-2" style={{color: '#007bff'}} />
            Generate report
          </Button>
          <div className="divider-nav me-4"></div>
          <Button variant="light" className="p-0">
            <ThreeDotsIcon width="20" height="20" style={{color: '#6c757d'}} />
          </Button>
        </Nav>
      </Container>
    </Navbar>
  );
}

export default AppNavbar;
